function urlBackgroundProvincia(etiqueta) { //DEFINE EL background DEL EVENTO MOUSEOVER PARA CADA PROVINCIA.
  var idEtiqueta = etiqueta;

  var urlFondo;
  for (var i = 0; i < regions.length; i++) {

    if (regions[i].nombre === idEtiqueta) {

      urlFondo = regions[i].url;
      break;
    }
  }
  return urlFondo;
}
/////////////////////////////////

function animaciones(objeto, fondo, opacidad) { // ANIMACION CAMBIO DE FONDO

    objeto.animate({
      fill: fondo,
      opacity: opacidad
    },500, 'linear');


}

//////////////////////

function mostraDivInformativo(parque) { //////////////////MUESTRA EL DIV CON LA INFORMACION DEL PARQUE SELECCIONADO


  var informacion = "";
  for (var i = 0; i < parques.length; i++) {
    if (parques[i].nombre === parque) {
      informacion = "Ubicado en el " + parques[i].areaConservacion + ", cuenta con una superficie de " + parques[i].superficie + " km cuadrados.";
      for (var a = 3; a > 0; a--) {
        document.getElementById("slide" + a).src = parques[i].urlImg + a + ".jpg";

      }
      break;
    }
  }
  $("#datos").html("<h1>" + parques[i].nombre + "</h1> <span>" + informacion + "</span>");
  //
  // new Vue({
  //   el:"#infoChart",
  //   data:{
  //     titulo: parques[i].nombre,
  //     info: informacion
  //   }
  // });

  $("#infoChart").modal({

    fadeDuration: 1000,
    fadeDelay: 0
  });


}


